INSERT INTO `blogs_components` (`id`, `blogs_id`, `position`, `type`, `language`, `paragraph`, `image_id`, `video`, `quote`, `quote_sign`, `css_class`, `link`, `title`, `add_date`, `add_user`, `update_date`, `update_user`, `delete_date`, `delete_user`) VALUES
(1, 1, 1, 'paragraph', 'en', 'Anja Rubik is a Polish model. She was born on June 12, 1983 in RzeszÃ³w, Poland. She is the most outstanding beauty queen. has been dubbed as \"Leading model\" and she preserves the environment by campaigning for people \"Stop using plastic straws\" when ordering drinks She believes that this is the first step in making people realize. and lead to the elimination of plastic glass and plastic bottles. She was inspired to do this project. After going scuba diving where she is an avid diver. She found that the water was full of plastic bottles and rubbish that had been thrown into the sea.', NULL, NULL, NULL, NULL, NULL, NULL, 'Meet Anja Rubik', 1657269809, 1, 1657269809, 1, 0, 0),
(2, 1, 1, 'paragraph', 'nl', 'Anja Rubik is een Pools model. Ze werd geboren op 12 juni 1983 in RzeszÃ³w, Polen. Ze is de meest opvallende schoonheidskoningin. is bestempeld als \"Toonaangevend model\" en ze spaart het milieu door campagne te voeren voor mensen \"Stop met het gebruik van plastic rietjes\" bij het bestellen van drankjes. Ze gelooft dat dit de eerste stap is om mensen bewust te maken. en leiden tot de eliminatie van plastic glas en plastic flessen. Ze werd geÃ¯nspireerd om dit project te doen. Na gaan duiken waar ze een fervent duiker is. Ze ontdekte dat het water vol stond met plastic flessen en afval dat in zee was gegooid.', NULL, NULL, NULL, NULL, NULL, NULL, 'Dit is: Anja Rubik', 1657269809, 0, 1657269809, 0, 0, 0),
(3, 1, 2, 'paragraph', 'en', 'She has also published a book titled SEXEDpl. about comprehensive sex education For teens, love and sex, the book quickly sold nationwide, selling over 200,000 copies and steadily becoming available in 2018, so she projects the SexedPL Foundation, Poland\'s most successful social foundation. It educates youth, parents and adults on human rights, gender equality, reproduction and gender appropriateness, emphasizing respect, inclusion, equality and accountability. Recognized by influential global institutions including UNFPA and the United Nations. She is also an active advocate for women\'s rights and supports the LGBT+ community in Poland. SEXEDpl this book is on point. and practicality It will help prepare young people for mature relationships. The first sexual initiation from both safe and psychological sex, respect and love for the body. self acceptance Teaching what love is is a very practical aspect.', NULL, NULL, NULL, NULL, NULL, NULL, 'SEXEDpl', 1657269921, 0, 1657269921, 0, 0, 0),
(4, 1, 2, 'paragraph', 'nl', 'Ze heeft ook een boek gepubliceerd met de titel SEXEDpl. over uitgebreide seksuele voorlichting Voor tieners, liefde en seks, het boek werd snel landelijk verkocht, er werden meer dan 200.000 exemplaren van verkocht en het kwam gestaag beschikbaar in 2018, dus projecteert ze de SexedPL Foundation, de meest succesvolle sociale stichting van Polen. Het onderwijst jongeren, ouders en volwassenen over mensenrechten, gendergelijkheid, reproductie en gendergeschiktheid, met de nadruk op respect, inclusie, gelijkheid en verantwoordelijkheid. Erkend door invloedrijke wereldwijde instellingen, waaronder UNFPA en de Verenigde Naties. Ze is ook een actieve pleitbezorger voor vrouwenrechten en ondersteunt de LGBT+-gemeenschap in Polen. SEXEDpl dit boek is op punt. en bruikbaarheid Het zal jonge mensen helpen zich voor te bereiden op volwassen relaties. De eerste seksuele inwijding vanuit zowel veilige als psychologische seks, respect en liefde voor het lichaam. zelfacceptatie Leren wat liefde is, is een heel praktisch aspect.', NULL, NULL, NULL, NULL, NULL, NULL, 'SEXEDpl', 1657269921, 0, 1657269921, 0, 0, 0),
(5, 1, 3, 'paragraph', 'en', 'But she gave an interview to British Vogue in 2021. As the Polish government attempts to censor sex education in 2020, the government\'s attack on sex education is an attack on our children and our future.', NULL, NULL, NULL, NULL, NULL, NULL, 'British Vogue', 1657270003, 0, 1657270003, 0, 0, 0),
(6, 1, 3, 'paragraph', 'nl', 'Maar ze gaf in 2021 een interview aan de Britse Vogue. Terwijl de Poolse regering in 2020 probeert seksuele voorlichting te censureren, is de aanval van de regering op seksuele voorlichting een aanval op onze kinderen en onze toekomst.', NULL, NULL, NULL, NULL, NULL, NULL, 'British Vogue', 1657270003, 0, 1657270003, 0, 0, 0),
(7, 1, 4, 'paragraph', 'en', 'Rubik has become one of Karl Lagerfeld\'s most recognizable inspirations and helped kick-start his creative director\'s career. Behind his designs, Rubik Meet designer Anthony Vaccarello, 2011. She helped organize and showcase his first runway collection, 2012.  And for the self-titled brand, she wore a mile-long gown to the first Met Gala in 2012.', NULL, NULL, NULL, NULL, NULL, NULL, 'Anthony Vaccarello', 1657270103, 0, 1657270103, 0, 0, 0),
(8, 1, 4, 'paragraph', 'nl', 'Rubik is een van Karl Lagerfelds meest herkenbare inspiratiebronnen geworden en heeft de carriÃ¨re van zijn creatief directeur een kickstart gegeven. Achter zijn ontwerpen schuilt Rubik Meet-ontwerper Anthony Vaccarello, 2011. Ze hielp bij het organiseren en presenteren van zijn eerste catwalkcollectie, 2012. En voor het gelijknamige merk droeg ze een kilometerslange jurk naar het eerste Met Gala in 2012.', NULL, NULL, NULL, NULL, NULL, NULL, 'Anthony Vaccarello', 1657270103, 0, 1657270103, 0, 0, 0),
(9, 1, 5, 'paragraph', 'en', 'Both her parents were veterinary doctors. She competed in the Elite Model Look and D\'ivision Model Agency. She moved to Paris where she graduated at England\'s Ãcole Bilingue High School. She moved to New York City, where she still lives and works, splitting her time between the United States, Paris and Warsaw and she continues to work as a model. Rubik has received numerous awards in recognition of her personal style and success as a model, winning the ZÅoty Nos Award in 2008, Pani Magazine, Prix de la Moda in 2021, Marie Claire  , Plejada Top Ten Award in 2012, Onet  and Elle Style Icon Award in 2014, Elle. She founded and created 25 annual magazines. She has also served as editor-in-chief. The magazine has become a creative force featuring artists and photographers from all angles on sensuality in  2012. She made a capsule collection with Giuseppe Zanotti in 2013 and IRO in 2016. She has released her first perfume, Original by Anja Rubik. Bottle design and campaign shot by Paola Kudacki in 2014.', NULL, NULL, NULL, NULL, NULL, NULL, 'career', 1657270239, 0, 1657270239, 0, 0, 0),
(10, 1, 5, 'paragraph', 'nl', 'Haar beide ouders waren dierenartsen. Ze nam deel aan de Elite Model Look en D\'ivision Model Agency. Ze verhuisde naar Parijs, waar ze afstudeerde aan de Ãcole Bilingue High School in Engeland. Ze verhuisde naar New York City, waar ze nog steeds woont en werkt, haar tijd verdeelt over de Verenigde Staten, Parijs en Warschau en ze blijft werken als model. Rubik heeft talloze onderscheidingen ontvangen als erkenning voor haar persoonlijke stijl en succes als model, het winnen van de ZÅoty Nos Award in 2008, Pani Magazine, Prix de la Moda in 2021, Marie Claire, Plejada Top Ten Award in 2012, Onet en Elle Style Icon Prijs in 2014, Elle. Ze stichtte en creÃ«erde 25 jaarlijkse tijdschriften. Ze heeft ook gediend als hoofdredacteur. Het tijdschrift is in 2012 een creatieve kracht geworden met kunstenaars en fotografen uit alle hoeken van sensualiteit. Ze maakte een capsulecollectie met Giuseppe Zanotti in 2013 en IRO in 2016. Ze heeft haar eerste parfum uitgebracht, Original van Anja Rubik. Flesontwerp en campagne gemaakt door Paola Kudacki in 2014.', NULL, NULL, NULL, NULL, NULL, NULL, 'carriÃ¨re', 1657270239, 0, 1657270239, 0, 0, 0),
(11, 1, 6, 'paragraph', 'en', 'She directed Issue 04\'s teaser film about the five senses. September 2015. The following year she hosted and moderated the Art & Fashion Forum, an open forum for inspiration and education. The 9th edition was held at Stary Browar in PoznaÅ every year since 2007. She has been invited to debate. at the 2016 Istanbul National Festival of Arts and Culture. In 2017, she joined the artist in a special edition of the Numero Berlin. She served as an advisory board member at the Brooklyn Museum from 2016 to 2018.', NULL, NULL, NULL, NULL, NULL, NULL, 'Art & Fashion', 1657270343, 0, 1657270343, 0, 0, 0),
(12, 1, 6, 'paragraph', 'nl', 'Ze regisseerde Issue 04\'s teaserfilm over de vijf zintuigen. September 2015. Het jaar daarop was ze gastheer en moderator van het Art & Fashion Forum, een open forum voor inspiratie en educatie. De 9e editie werd sinds 2007 elk jaar gehouden in Stary Browar in Pozna. Ze is uitgenodigd om te debatteren. op het 2016 Istanbul National Festival of Arts and Culture. In 2017 voegde ze zich bij de kunstenaar in een speciale editie van de Numero Berlin. Ze was van 2016 tot 2018 lid van de adviesraad van het Brooklyn Museum.', NULL, NULL, NULL, NULL, NULL, NULL, 'Art & Fashion', 1657270343, 0, 1657270343, 0, 0, 0),
(13, 2, 0, 'column_2', 'en', '<p>sdihfgd;ifgh lqgqeh gpuqerh giuehqfiquheg puhr gpiugrhe gphureg pgqufhirfueiuh qigurh euihb erqiuhg iqufeh vqfiuhv;diuhv;efuvh ;fqeiuhv ;ieruhv ;eiquhger;iuhjfg q;ergher;iuhgluwrthgkurygkauyerghfl uyrgh re gyu qgleuryhg laeiuhgre lagrygr&nbsp; lrgyhagrluyghr lgriuh grlugladuhglie laewba erlieruab fliaurhgre;gurhagrolurgehagouhergayr r r eaygagreliuahrg liuadha giahgr agluihag fd lugfadhgadofh agrleiu gareuagrhagagr rgalyag rgal algh gfdlfgdah gad</p>', 0, '', '', '', '', '', 'Test blok', 1657273509, 1, 1657273903, 1, 0, 0),
