(1, 1, 'en', 'Anja Rubik', 'Anja Rubik', 'Anja Rubik is a Polish model. She was born on June 12, 1983 in RzeszÃ³w, Poland. She is the most outstanding beauty queen. has been dubbed as \"Leading model\" and she preserves the environment by campaigning for people \"Stop using plastic straws\" when ordering drinks She believes that this is the first step in making people realize. and lead to the elimination of plastic glass and plastic bottles. She was inspired to do this project. After going scuba diving where she is an avid diver. She found that the water was full of plastic bottles and rubbish that had been thrown into the sea.', 'Anja Rubik is a Polish model. She was born on June 12, 1983 in RzeszÃ³w, Poland.', 'Anja Rubik is a Polish model. She was born on June 12, 1983 in RzeszÃ³w, Poland.', '', 1657269546, 0, 1657269546, 0),
(2, 1, 'nl', 'Anja Rubik', 'Anja Rubik', 'Anja Rubik is een Pools model. Ze werd geboren op 12 juni 1983 in RzeszÃ³w, Polen. Ze is de meest opvallende schoonheidskoningin. is bestempeld als \"Toonaangevend model\" en ze spaart het milieu door campagne te voeren voor mensen \"Stop met het gebruik van plastic rietjes\" bij het bestellen van drankjes. Ze gelooft dat dit de eerste stap is om mensen bewust te maken. en leiden tot de eliminatie van plastic glas en plastic flessen. Ze werd geÃ¯nspireerd om dit project te doen. Na gaan duiken waar ze een fervent duiker is. Ze ontdekte dat het water vol stond met plastic flessen en afval dat in zee was gegooid.', 'Anja Rubik is een Pools model. Ze werd geboren op 12 juni 1983 in Rzeszow, Polen.', 'Anja Rubik is een Pools model. Ze werd geboren op 12 juni 1983 in Rzeszow, Polen.', '', 1657269546, 0, 1657269546, 0),
