INSERT INTO `faq_description` (`id`, `faq_id`, `question`, `answer`, `language`, `add_date`, `add_user`, `update_date`, `update_user`) VALUES
(1, 1, 'What is Mollie', 'Mollie is our payment profider offered by MO finance services. Mollie is from the Mollie payments Foundation. Mollie\'s creditor ID is: NL08ZZZ502057730000', 'en', 1650881096, 0, 1650881096, 0),
(2, 2, 'What is MO finance services', 'MO finance services is the account owner of Mollie\'s account. They take care of, among other things, the administration part of all payments within our platforms.', 'en', 1650881096, 0, 1650881096, 0),
(3, 3, 'Can I terminate my account?', 'You can terminate your account via your account settings. After loggin in, visit your <a href = \'./settings\'>settings</a> to terminate your account.', 'en', 1650881096, 0, 1650881096, 0),
(4, 4, 'Can I ask for my money back?', 'You can request your money back from your subscription 30 days after closing your account. Unfortunately, this is not possible if you change the subscription, then you are stuck with the monthly cancellation period. <p>To get your money back contact our helpdesk <a href = \'./contact\'>contact</a> .', 'en', 1650881096, 0, 1650881096, 0),
(5, 5, 'How do I update my email', 'You need to go to you account overview\r\nand then press on edit.', 'en', 1650881096, 0, 1650881096, 0);

