(420, 'copyrightText', 'y', 1545639785, 0, 1545639785, 0, 'y', '', '', '<h4>Copyright</h4>\r\n\r\n<p>In geen geval mag enige inhoud van de webapp, website, CMS en / of API worden gebruikt zonder voorafgaande schriftelijke toestemming van Model Agency. \r\nVoor publicaties is een mediapakket beschikbaar. Dit mediapakket is gratis te downloaden via onze website of op te vragen via de contactgegevens onderaan dit documentop onze contactpagina.\r\n<p>Bij onrechtmatig gebruik van het mediapakket of de inhoud van de web-app, website, CMS en / of API behoudt Model Agency zich uitdrukkelijk het recht voor om per overtreding een boete op te leggen en / of gerechtelijke stappen te ondernemen, conform de voorschriften als vastgelegd in de Nederlandse wet.</p>\r\n\r\n<h4>Content</h4>\r\n\r\n<p> Model Agency is niet verantwoordelijk voor de kwaliteit van afbeeldingen van gebruikers, ontbrekende of verkeerde informatie en taalfouten binnen het CMS, API en web app. In geval van misbruik van de content feature behoudt Model Agency zich het recht voor de content te verwijderen zonder mededeling aan de gebruiker. Misbruik kan omvatten, maar is niet beperkt tot: het plaatsen van ongepaste foto\'s inclusief naaktafbeeldingen, schokkende afbeeldingen, discriminerende teksten of uitingen, ongepaste of misleidende teksten ect. Als Model Agency besluit om inhoud te verwijderen, is het niet mogelijk om hierover met Model Agency te communiceren en is de beslissing van Model Agency definitief.</p>', '<h4>Copyright</h4>\r\n\r\n<p>In no event may any content from the web app, website, CMS and/or API be used without Model Agency\'s prior written consent.\r\nA media package is available for publications. This media package can be downloaded free of charge from our website or can be requested via the contact details at contact page.</p>\r\n<p> In the event of unauthorized use of the media package or the content of the web app, website, CMS and/or API, Model Agency expressly reserves the right to impose a fine and/or take legal action per violation, in accordance with the regulations as laid down in Dutch law.</p>\r\n\r\n<h4>Content</h4>\r\n\r\n<p> Model Agency is not responsible for the quality of user images, missing or incorrect information and language errors within the CMS, API and web app. In case of abuse of the content feature, Model Agency reserves the right to remove the content without notifying the user. Abuse may include, but is not limited to: posting inappropriate photos including nude images, shocking images, discriminatory texts or expressions, inappropriate or misleading texts ect. If Sugardating decides to remove content, it will not be possible to continue communicating with Model Agency and Model Agency\'s decision will be final.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
