(975, 'our_story_content_short', 'y', 0, 0, 0, 0, 'n', '', 'Io (Peter Baan) ero a Hong Kong nel 2017, in un ristorante carino e accogliente con vista sull\'acqua. Dopo circa 20 minuti sono stato avvicinato da un\'adorabile signora con il messaggio che dovevo sedermi da qualche altra parte perchÃ© questo posto era pensato per i clienti e non per il turismo. Sono rimasto sorpreso, perchÃ© volevo anche mangiare un boccone dopo un lungo incontro e le ho chiesto il menu per poterlo ordinare. A cui ha indicato il tavolo. Sul tavolo c\'era un adesivo molto usurato con sopra un sito web. \"Qui, qui, ordina adesso,\" disse, e se ne andÃ². Tramite il WiFi del ristorante e con molta pazienza sono riuscito a ordinare una tazza di caffÃ¨ e quello che poi si Ã¨ rivelato essere una specie di involtino primavera fresco con verdure. Ma mi ha venduto l\'idea di un menu digitale...', 'Ik (Peter Baan) was in 2017 in Hong Kong, in een leuk, gezellig restaurantje uitkijkend over het water. Na ongeveer 20 minuten werd ik aangesproken door een lieftallige dame met de boodschap dat ik ergens anders moest gaan zitten omdat deze zitplaats voor klanten was bedoeld, en niet voor toerisme. Ik was verbaasd, want ik wou graag ook een hapje eten na een lange vergadering, en vroeg haar dan ook om de menukaart om te kunnen bestellen. Waarop zij wees naar de tafel. Op de tafel zat een zeer versleten sticker met een website er op. âHere, here, order now,â zei ze, en ze liep weg. Via de WiFi van het restaurant en met veel geduld wist ik een kopje koffie te bestellen en wat later een soort verse loempia met groente bleek. Maar ik was verkocht door het idee van een digitale menukaart...', 'In 2017, I (Peter Baan) travelled to Hong Kong, and visited a wonderfully cosy restaurant near the waterside. After about 20 minutes, I was approached by a lovely lady who kindly asked me to move, because my seat was meant for customers, not tourists. Surprised, as I had wanted to order a bite to eat after a long meeting, I asked her for the menu. She pointed to the table. On it was a worn out sticker with a website address. \"Here, here, order now,\", she told me, and left. Using the restaurant\'s WiFi and a lot of patience I managed to order a cup of coffee, as well as what turned out to be a fresh spring roll with veggies. But I was sold by the idea of a digital menu...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
