(1143, 'cookie_policy_content', 'y', 0, 0, 0, 0, 'y', NULL, '', 'Wij maken gebruik van cookies om onze dienstverlening te verbeteren maar gebruiken deze niet om persoonlijke advertenties te generen of je te tracken. Alle gegevens die we verzamelen, verzamelen we anoniem en verwerken we anoniem. Niets is dus te herleiden naar jou.  Gegevens die verzameld worden behouden wij maximaal 6 maanden daarna worden ze vernietigt. Wens je niet gevolgd te worden kunt u dit aangeven bij je eerste bezoek aan onze website of na 30 dagen, wanneer wij je opnieuw informeren over de gebruik van cookies. Wij hebben privacy hoog in het vaandel staan en maken geen gebruik van Google Analytics of andere grote trackers. Deze partijen kunnen je niet traceren, volgen of persoonlijke advertenties aanbieden.', 'We use cookies to improve our service, but do not use them to generate personal advertisements or track your personal information. All data we collect is collected anonymously and processed anonymously. So nothing can be traced back to you. Collected data is kept for a maximum of 6 months after which it is destroyed. If you do not wish to be tracked, you can indicate this on your first visit to our website or after 30 days, when we inform you again about the use of cookies. We consider privacy to be of paramount importance and do not use Google Analytics or other large trackers. These parties cannot track, trace or serve you personalised advertisements.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
