(1258, 'privacyPolicyText', 'y', 0, 0, 0, 0, 'n', NULL, '', 'Wij nemen uw privacy zeer serieus en begrijpen dat een aantal van onze klanten graag anoniem blijft. Daarom zorgen wij dat afschriften niet linken aan onze diensten maar als dienst van MO finance services. Alle opgeslagen persoonsgegevens zijn versleuteld en worden volledig verwijderd als je besluit je account te verwijderen. Jouw gegevens zijn niet zichtbaar voor andere gebruikers. Je blijft volledig anoniem tenzij jij je gegevens met een andere gebruiker deelt. Zij zullen deze data nooit van ons krijgen! Wij hebben dan ook een âcustom build trackersâ. Deze slaat alleen de flow van bezoekers op om onze dienstverlening te verbeteren. Dit is niet gekoppeld aan een account of aan je IP adres en door dus rond te serven op onze website blijf je dan ook anoniem. Deze gegevens slaan we maximaal 6 maanden op en zijn volledig versleuteld. Als je meer informatie wenst over welke gegevens wij opslaan of welke gegevens wij van jou hebben kun je dit downloaden doen via je dashboard na dat je bent ingelogt. Wens je de gegevens te verwijderen kun je jouw account volledig verwijderen via hetzelfde dashboard of stuur ons een bericht met het verzoek je persoonsgegevens te wissen. Als je nog vragen hebt kun je ons ten alle tijden een bericht sturen via de <a href = \"./contact?source=./privacy\" >contact pagina</a>. \r\n<p>\r\nBent u het niet eens met hoe een organisatie met uw persoonsgegevens omgaat? En komt u er samen met de organisatie niet uit? Dan kunt u een privacyklacht melden bij de Autoriteit Persoonsgegevens (AP). </p>', 'Your privacy is something we take very seriously. We understand that some of our customers prefer to remain anonymous. That is why we ensure that statements are not linked to our services, but as a service of MO finance services. All stored personal data is encrypted and will be completely deleted if you decide to delete your account. Your data is not visible to other users. You remain completely anonymous unless you share your information with another user. They will never get this data from us! We have âcustom build trackersâ. They only store the flow of visitors to improve our services. This is not linked to an account or to your IP address. We store this data for a maximum of 6 months and it\'s fully encrypted. If you want more information about what data we store or what data we have on you, you can download this via your dashboard after you login. If you wish to delete the data, you can completely delete your account via the same dashboard or send us a message with the request to delete your data. If you have any questions, you can send us a message at any time via the <a href = \"./contact?source=./privacy\" >contact page</a>.\r\n<p>\r\nYou can report a privacy complaint to the Dutch Data Protection Authority (AP) if you disagree with how an organisation handles your data.\r\n</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
