(1355, 'who_are_we_text', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Sugardating.online bestaat uit een aantal welvarende ondernemers. Met regelmaat komen we samen voor een whiskyproeverij, succes verzekerd! Uit deze bijeenkomsten vloeide sugardating.online voort.  ', 'Sugardating.online consists of several affluent entrepreneurs. Regularly we gather for whiskey tastings, success guaranteed! From these gatherings, sugardating.online emerged.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
