(1357, 'the_whiskey_tasting_text', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Voor deze specifieke avond kozen we vier verschillende whisky\'s. Meer dan normaal, meestal hebben we er maar Ã©Ã©n of twee. Tijdens een proeverij speelt drank niet de hoofdrol, het is een gelegenheid om te netwerken. Soms neemt iemand een introducee mee, zoals G. dat deed. Zijn gezelschap bleek een mooie dame met een betoverende glimlach. Naar mate de proeverij vorderde nam de lol het over van het zakelijke en iedereen was benieuwd hoe G. en deze godin elkaar hadden gevonden.', 'For this specific whisky tasting, we chose four different types. More than normal, most of the time there are only one or two. During such a tasting itâs not about the booze, so to speak, itâs a great opportunity to network. Sometimes one of the guests brings an introducee as G. did. His company consisted of a very beautiful young lady with a killer smile. As the tasting commenced fun took over from business and all wondered how G. and this goddess met.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1358, 'the_sugar_goddess', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'De sugargodin', 'The sugar goddess', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1359, 'the_sugar_goddess_text', 'y', 0, 0, 0, 0, 'y', NULL, '', 'Ze heette Daisy* en deze dame en G. ontmoetten elkaar online op een âsuikerdateâ platform. We waren ontzettend benieuwd wat dat inhield aangezien een aantal van ons nog nooit van âsugar datingâ hadden gehoord. Na een aantal vragen gesteld te hebben namen we een kijkje op de profielen van Daisy* en G. Zakelijk inzicht is nooit ver weg en we zagen dat er vaak veel mis is met dit soort platformen. Geen optimale vormgeving waardoor het navigeren lastig is. Veel dubbele content en weinig of geen actieve gebruikers. Extreem hoge prijzen en geen goede controle op wie er op het platform opereert. We vonden dat dit beter kon! Unaniem besloten we bij te dragen aan een nieuw en beter platform, geschikt voor de huidige tijd.', 'Her name was Daisy*. This lady and G. met online at a âsugar datingâ platform. We were extremely curious what it was all about because some of us never even heard of âsugar datingâ before. After gaining insight we decided to take a look for ourselves, discovered the profiles of Daisy* and G. Business insight is only a step away and we believed that there are a lot of sketchy platforms found on the internet. Terrible design flaws that make it difficult to navigate. Double content and few or even no active users. Extreme high fees and no control over who operates on a platform like this. We believed that there was room for improvement! Unanimously we decided to combine forces to create a new and better platform, suited for modern times.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
