(1367, 'twelve_of_fifteen', 'y', 0, 0, 0, 0, 'n', NULL, NULL, '12 van de 15', '12 of 15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1368, 'twelve_of_fifteen_text', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'Eerst hebben we marktonderzoek gedaan, waaruit blijkt dat ondertussen 12 van de 15 gasten in de groep ervaring heeft met sugardating. Dus was nu tijd om deze manier van daten het volwassen platform te bieden dat het verdient. Al snel werden wij het snelst groeiende datingplatform binnen de Benelux als het op sugardating aankomt. We zijn open en transparant om zo voor een veilige omgeving te zorgen.<br/><br/>Het platform is anoniem te gebruiken. Alle persoonsinformatie staat los van het account en je kunt zelf instellen hoeveel jij over jezelf prijs geeft. Hoe meer jij over jezelf vertelt, hoe beter je beloond wordt - dat vinden wij wel zo eerlijk. Kijk hier voor alle <a href=\"./rules\" class=\"text-primary\">spelregels</a>.<br><br>We wensen je veel plezier op onze datingsite en natuurlijk horen we graag je ervaringen!<br/><br/>G, A, M, B, P, T, S, P, M, A, S, L, R, T en V **', 'We first did a market survey, which showed that 12 out of 15 guests in the group have experience with sugar dating. So now was the time to offer this way of dating the mature platform that it deserves. We quickly became the fastest growing dating platform in the Benelux when it comes to sugar dating. We are open and transparent to ensure a safe environment.<br/><br/>The platform can be used anonymously. All personal information is separate from the account and you can set yourself how much you reveal about yourself. The more you tell us about yourself, the better you will be rewarded - we think that\'s fair. Look here for all <a href=\"./rules\" class=\"text-primary\">rules</a>.<br><br>We hope you enjoy our dating site and of course we would love to hear your experiences!<br/><br/>G, A, M, B, P, T, S, P, M, A, S, L, R, T and V **\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1369, 'about_us_footer_1', 'y', 0, 0, 0, 0, 'n', NULL, NULL, '* Daisy is niet haar echte naam maar wij danken haar om het verhaal compleet te hebben kunnen maken.', '* Daisy is not her real name but we thank her for sharing her story.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1370, 'about_us_footer_2', 'y', 0, 0, 0, 0, 'y', NULL, NULL, '** Ook wij blijven graag anoniem maar komen graag in contact met je via onze <a href=\"./contact\" class=\"text-primary\">contact</a> pagina. Wij kiezen hiervoor om duidelijk te maken dat het voor iedereen mogelijk is, zo ook voor ons als organisatie.', '** We also like to remain anonymous but would like to get in touch with you via our <a href=\"./contact\" class=\"text-primary\">contact</a> page. We choose this to make clear that it is possible for everyone, including us as an organisation.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1371, 'contact_text', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Wij staan graag voor je klaar om je te helpen. Vul het contactformulier in en we komen zo snel mogelijk bij je terug.', 'We are happy to assist you. Fill in the contact form and we will get back to you as soon as possible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1372, 'rules_title', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Als iedereen zich aan de regels houdt blijft het leuk!', 'Itâs going to be fun if everyone sticks to the rules!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1373, 'rules_text', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'Iedereen snapt dat er spelregels zijn als het gaat om een platform. Niet iedereen heeft er zin in om de volledige algemene voorwaarden door te lezen die vaak bol staan van hocus pocus taal. Daarom hebben we de belangrijkste punten voor je op een rijtje gezet. Als we ons aan de regels houden blijft het platform voor iedereen leuk. We zullen degenen die zich niet aan het reglement houden hierop aanspreken. Wij verbinden consequenties aan het herhaaldelijk overschrijden van de regels. Je bent dus gewaarschuwd. Lees alles over jouw deelname hier in onze <a href = \"./tos\" \r\n class = \"link\" >algemene voorwaarden</a>.', 'Everyone understands that there are standards when it comes to a platform. Not everyone wants to read through the full terms and conditions. They often contain lots of hocus pocus language. That is why we have listed the most essential points for you. If we stick to the rules, the platform will remain fun for everyone. We will address those who do not adhere to the regulations. We attach consequences for repeatedly breaking the rules. Be warned. You can read all about your partaking here in our <a href = \"./tos\" \r\n class = \"link\" >terms and conditions</a>.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
