(1381, 'what_is_sugar_dating_text', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'We hebben een hele pagina besteed om je uit te leggen wat sugardating inhoudt. Als je hierna nog vragen hebt, dan raden we je aan onze FAQ te raadplegen of anders contact met ons op te nemen.', 'We\'ve spent an entire page explaining what sugar dating is all about. If you still have questions after this, we recommend that you consult our FAQ or otherwise contact us.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1382, 'sugardating_info_title_1', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Wat maakt sugardating anders?', 'What makes sugar dating different?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1383, 'sugardating_info_content_1', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Bij sugardating wordt voor een andere insteek gekozen en verschilt in een aantal opzichten van ânormaalâ daten. Er worden vooraf afspraken gemaakt waardoor er geen er geen kans is op teleurstellingen of irreÃ«le verwachtingen. Je weet waar je heen gaat, met wie en wat je ervoor terug krijgt. Ook mag je verwachten dat het contact met je sugarpartner niet zo intens is als bij regulier daten. Het is daten zonder lasten en uiteraard gebeurt alles op vrijwillige basis. Sugardaten verschilt van prostitutie in die zin dat je de andere persoon in kwestie kent en het om jullie om de connectie draait in plaats van de intimiteit (lees: seks). Een ander verschil is de vergoeding die je van je sugarpartner kan verwachten, deze hoeft niet perse uit financiÃ«le contanten te bestaan.', 'Sugar dating takes a different approach and differs from \'normal\' dating in several ways. Agreements are made in advance, so there is no chance of disappointments or unrealistic expectations. You know where you are going, with whom and what you get in return. You can also expect that the contact with your sugar partner is not as intense as with regular dating. It is dating without burdens and of course, everything is voluntary. Sugar dating differs from prostitution in that you know the other person and it\'s about the connection rather than the intimacy (read: sex). Another difference is the compensation you can expect from your sugar partner, this does not necessarily have to consist of financial cash.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1384, 'sugardating_info_title_2', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Jullie eerste date.', 'Your first date. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1385, 'sugardating_info_content_2', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'Wij raden je aan, als het tot de eerste date tussen jullie komt om in een publieke ruimte af te spreken. Een restaurant of een park bijvoorbeeld. Hoewel jullie al twee maanden aan het chatten zijn weet je nooit met wie je afspreekt, ben hier voorzichtig mee.\r\nVaak wordt er verwacht dat zoân eerste date meteen een vergoeding oplevert. Dit hoeft niet zo te zijn dus overleg dit met je partner. Tegenover een sollicitatiegesprek staat immers ook geen tegemoetkoming. De ene partner is de andere niet. De een neemt bij de kennismakingsdate een bloemetje mee, een ander doet dat wellicht niet. \r\nHet is belangrijk dat je een goede eerste indruk maakt. Zie er dan ook op je paasbest uit en zorg dat je aan de verwachtingen van je partner voldoet. Probeer de uitgesproken wensen omtrent uiterlijk en/of verzorging zoveel mogelijk na te leven.', 'We recommend that if it comes to the first date between the two of you, that you meet in a public place. A restaurant or a park, for example. Although you\'ve been chatting for about two months, you never know who you\'ll meet, please consider this.\r\nIt is often expected that a first date immediately yields compensation. This does not have to be the case, so discuss this with your partner. After all, a job interview doesn\'t earn you any compensation, right?\r\nFurthermore, every sugar partner is different. One will bring flowers to the introductory date, another may not.\r\nAlso, you must make a good first impression. Look your very best and make sure you meet the expectations of your partner. Try to comply with the expressed wishes regarding appearance and/or care as much as possible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1386, 'sugardating_info_title_3', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Vergoedingen', 'Fees', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1387, 'sugardating_info_content_3', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'Als het op een vergoeding aankomt dan kunnen de ideeÃ«n daarover uiteenlopen. Het kan zomaar variÃ«ren van een volledig maandsalaris tot een vergoeding per date. Wat heb jij over voor je partner en wat eist jouw partner van jou? Bespreek dit zo veel mogelijk via de chatfunctie op ons platform. Doe dit vooraf om misverstanden te voorkomen maar ook om de gemaakte afspraken terug te halen als dit nodig mocht blijken.\r\nVergoedingen hoeven niet altijd in de vorm van geld te komen. Het kan ook een dagje shoppen zijn waarbij je leuke, nieuwe kleding ontvangt of een ander cadeau waar je naar verlangt. In een enkel geval wordt de huur of hypotheek betaald of kun je rijden in een gefinancierde auto. Wat de vergoeding ook is, wees hier open en eerlijk over. Op die manier kom je niet voor onplezierige verrassingen te staan.', 'When it comes to compensation, ideas can differ. It can vary from a full monthly salary to a fee per date. What are you willing to do for your partner and what does your partner require from you? Discuss this as much as possible via the chat function on our platform. Do this in advance to avoid misunderstandings, but also to recall the agreements made if this proves necessary.\r\nCompensation does not always have to come in the form of money. It can also be a day of shopping where you receive nice, new clothes or another gift that you long for. In some cases the rent or mortgage is paid or you are given a financed car. Whatever the fee, be open and honest about it. That way you won\'t be faced with unpleasant surprises.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1388, 'sugardating_info_title_4', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Sugarpartners', 'Sugar partners', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1389, 'sugardating_info_content_4', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'De meest bekende sugarrelatie is wel die van sugarbabe en sugardaddy, ook wel suikeroom en suikernichtje genoemd. Er zijn echter andere combinaties denkbaar. Zo kan een sugarmommy een sugarguy zoeken. Bovendien hoeft een relatie niet perse een heteroseksuele te zijn. Een sugarddaddy kan een sugarguy zoeken en een sugarmommy een sugarbabe. Alle combinaties zijn mogelijk. Een sugardaddy die een sugarbabe en een sugarguy heeft is ook een optie. Zoveel mensen, zoveel wensen. Respecteer elkaar hierin en dwing iemand niet in een relatie waar ze zich niet in thuis voelen. Het is niet leuk voor die persoon en uiteindelijk ook niet voor jou.', 'The most famous sugar relationship is that of sugar babe and sugar daddy. However, other combinations are imaginable. For example, a sugar mommy can search for a sugar guy. Furthermore, a relationship does not necessarily have to be a heterosexual one. A sugar daddy can search for a sugar guy and a sugar mommy can prefer a sugar babe. Every combination is possible. Another alternative is a sugar daddy who is in a relationship with a sugar babe and a sugar guy. There are as many opinions as people. Please respect each other in this matter and don\'t force someone into a relationship where they don\'t feel at ease. In the end, you both will not benefit from this.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1390, 'sugardating_info_title_5', 'y', 0, 0, 0, 0, 'n', NULL, NULL, 'Past sugardating bij mij?', 'Does sugar dating fit me?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1391, 'sugardating_info_content_5', 'y', 0, 0, 0, 0, 'y', NULL, NULL, 'Wanneer past sugardaten wel bij je en wanneer niet? We hebben een checklist voor je gemaakt als leidraad. Op deze manier kun je een goede inschatting maken.\r\n\r\n- Wat fijn zoân drukke agenda.\r\n- Geef je carriere een boost! Op deze manier wordt je geintroduceerd binnen diverse netwerken.\r\n- Je doet dit niet uit geldnood. \r\n- Voor een intellectueel gesprek draai jij je hand niet om. \r\n- Flexibel is jouw âmiddelnameâ. Je hebt er geen moeite mee jouw eigen wensen soms los te laten.\r\nEr zijn nog 1001 redenen te verzinnen om je te begeven in de wereld die sugardating heet. Het belangrijkste is dat jij je er prettig bij voelt. Probeer het eens uit, stoppen kan altijd. Niemand verplicht je tot iets.', 'Should you go on a sugar date or not? We have prepared a checklist as a guideline. This way you can make a good estimate.\r\nâ¨\r\n- I love a busy schedule.\r\n- Boost your career! This is a great opportunity to get an introduction to various networks.\r\n- You are not doing this because you lack funds. This will not be your main source of income.\r\n- Your are able to have an intellectual conversation.\r\n- Flexible is your middle name. You have no problem putting aside your wishes from time to time.\r\nThere are more than enough reasons to enter the world of sugar dating. The most important thing is that you feel comfortable with everything you do. Just try it, no one will force you to do anything you don\'t want to do.\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
