(1747, 'text_why_loyalty', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, '<p>Iedereen wil zekerheid. Zeker als het aankomt op daten en al helemaal als het om sugardating gaat.&nbsp</p><p>Je wilt niet iemand treffen die maar wat van de daken schreeuwt of bij wie je een risico loopt op narigheid. Omdat wij dat ook begrijpen, hebben wij loyalty points in het leven geroepen. Hieraan kan je aflezen hoe betrouwbaar iemand is.</p><p>Hoe hoger het aantal punten dat iemand heeft binnen het platform, hoe actiever, betrokkener hij of zij is, en hoe meer informatie deze persoon aan ons platform heeft verstrekt. Hierdoor kan jij beter bepalen of jouw nieuwe sugardate waardig genoeg is voor een vertrouwd avontuur.</p>', '<p>Everyone wants certainty. You don\'t want to get into dating, especially when it comes to sugar dating. Because we understand that too, we have created loyalty points. This shows how reliable someone is.</p><p>The higher the number of points someone has accrued on the platform, the more active and involved he or she is, and the more information this person has provided to us. This way, you can easily and safely determine if your new sugar date is worthy enough for an new adventure. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
