(1769, 'who_are_you_loyalty_text', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, 'Als jij open bent, verdien je daar royaal mee. Identiteitscontrole, adresgegevens en een bevestigd e-mailadres leveren dan ook punten op.', 'If you are open about yourself, you will earn generously. Therefore, an identity check, address details and a confirmed e-mail address are worth more points.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
