(1781, 'bianca_test_loyalty_conv', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, 'De ervaring van Bianca', 'Bianca\'s experience', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1782, 'bianca_test_loyalty_conv_text', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, '<p class=\"mbr-text mbr-fonts-style mb-4 display-7\">F (mede-eigenaar van dit platform) had mij gevraagd om een stukje te schrijven over hoe ik mijn date was misgelopen, tot twee keer toe. Ik ken F van de werkvloer toen ik stage bij hem liep en heb zelfs geholpen aan onderdelen van dit platform. Dus ik zou beter moeten weten hoe het werkt.</p><p>Integendeel zelfs! Ik had een bord voor mijn kop, zo bleek! Mijn eerste contact was met \"Mister J\". We hadden leuk contact we stuurde berichten heen en weer en zelfs wat spannende foto\'s. \"Mister J\" had een hoge score van boven de 400 punten en ik was onder de indruk en wou graag afspreken voor een eerste date. Maar het voorstel van hem bleef uit, dus ik trok de stoute schoenen aan en vroeg of we misschien een leuke sauna-date konden gaan doen. Au, het antwoord doet nog steeds pijn als ik er aan terug denk: \'Nee schat, want ik date allen dames met meer dan 150 punten\'. Met een bek vol tanden en slechts 35 punten miste ik dus de boot bij \"Mister J\".</p><p>Eerst vervloekte ik hem met zijn 400+ loyalty points. Het zou aan hem liggen en niet aan mij. Er zijn meer vissen in deze zee, dacht ik, dus ik ging gewoon op zoek naar een andere leuke vent. </p><p>\"Kees\" was iets sneller om me op mijn punten te wijzen. Na enkele berichten vroeg hij wanneer ik aan ging tonen dat ik te vertrouwen was door mijn punten te verhogen? Toen was de maat vol en heb ik mijn adres opgegeven, de identiteitscheck gedaan, me ingeschreven op de nieuwsbrief en ben ik een aantal blogs gaan lezen, waar ik ook weer leerde heb hoe ik andere zaken aan kon pakken. Ondertussen daten \"Kees\" en ik al sinds november 2020 en hebben samen heel veel plezier.</p>', '<p class=\"mbr-text mbr-fonts-style mb-4 display-7\">F (co-owner of this platform) had asked me to write a piece about how I had missed my date, twice . I know F from the shop floor when I did an internship with him and even helped with parts of this platform. So I should know better how it works.</p><p>On the contrary! I had it all wrong, as it turned out! My first contact was with \"Mister J\". We had great contact - we sent messages back and forth and even shared some exciting photos. \"Mister J\" had a score of over 400 points and I was impressed and wanted to meet for a first date. But he didn\'t propose to meet up, so I took the plunge and asked if we could go on a nice sauna date. Ouch, the answer still hurts when I think back to it: \'No honey, because I only date ladies with more than 150 points\'. With only 35 points, I missed the boat at \"Mister J\".</p><p>First I cursed him with his 400+ loyalty points. It was his fault, not mine. Oh, well, I thought, there are more fish in this sea, so I just went looking for another nice guy. </p><p>\"Kees\" was a little quicker to point out my low points score. After a few messages back and forth, he asked when I was going to show that I could be trusted by increasing my points? Enough was enough, and I completed my address details, did the identity check, subscribed to the newsletter and I started reading a number of blogs, where I also learned how to tackle some other things. Meanwhile, \"Kees\" and I have been dating since November 2020 and are having a lot of fun together.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1783, 'benefits_loyalty_conv_title', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, 'Voordelen van meer punten', 'Benefits of more points', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1784, 'benefits_loyalty_conv_text', 'y', 1629987813, 0, 1629987813, 0, 'y', NULL, NULL, '<ul>\r\n <li>Als je score hoger is, geeft dit <strong>meer vertrouwen</strong>&nbsp;aan andere leden.<br></li>\r\n <li>Je ontvangt meer berichten en andere extra\'s</li>\r\n <li>Je koopt geen loyalty points; deze krijg je als <strong>beloning</strong></li><li>Het helpt je om ook<strong> serieuzer </strong>genomen te worden</li><li><strong>Betere onderhandelingspositie </strong>bij je volgende date</li>\r\n </ul>', '<ul>\r\n                             <li>If your score is higher, it <strong>increases confidence</strong>&nbsp;for other members.<br></li>\r\n                             <li>You will receive more messages and other extras</li>\r\n                             <li>You do not buy loyalty points, you get these as a <strong>reward</strong></li><li>It also helps you to be<strong> taken more seriously </strong></li><li> <strong>Better negotiating position </strong>on your next date</li>\r\n                         </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
