(1793, 'stay_ahead_bijbaan', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, 'Blijf geldproblemen voor!', 'Stay ahead of money problems!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1794, 'stay_ahead_bijbaan_text', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, 'Vele van ons weten het, het studentenleven is een zware tijd. Een drukke studie, een eigen kamer, contact behouden met vrienden, noem zo maar op. Dat alles moet ook nog eens bekostigt worden, en het kost wat allemaal.Er zijn veel studenten zoals <strong>jij</strong> die met geld problemen hebben te kampen. Vaak is er ook weinig tijd om te werken naast je studie en alle andere activiteiten. Hierdoor ontstaan vaak geldproblemen en moet je inleveren op de leukere dingen van het studentenleven.<br><br>Gelukkig is er is een passende oplossing! <strong>Sugardating, of wel:&nbsp;</strong>daten ondervoorwaarden. Op deze manier verdien jij een leuk een zakcentje terwijl je ook nog eens lekker uit kan gaan tegen ene leuke <b>studentekorting<b>', 'Many of us know, student life is a tough time. A busy study, a private room, keeping in touch with friends, you name it. All this also has to be paid for, and it costs a lot. There are many students like <strong>you</strong> who have problems with money. Often there is also little time to work in addition to your studies and all other activities. This often causes money problems and you have to give up on the nicer things in student life.<br><br>Fortunately, there is a suitable solution! <strong>Sugardating, or:&nbsp;</strong>dating under conditions. This way you earn a nice pocket money while you can also go out for a nice <b>student discount<b>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
