(1797, 'bijbaan_benefits_text', 'y', 1629987813, 0, 1629987813, 0, 'n', NULL, NULL, '<ul>\r\n                            <li><strong><em>Flexsibel</em></strong> en wanneer het jou uitkomt!</li>\r\n                            <li>Een vaste datings partner naar jou keuze</li>\r\n                            <li>Vrij in wat je wel en niet wil doen door vooraf afgesproken kaders</li>\r\n                            <li>Geld verdienen met lekker eten en spannend uitgaan</li>\r\n                            <li><strong><em>Leuke</em></strong>&nbsp;( onverwachte <strong><em>extra\'s</em></strong> van je sugardaddy of -mommy</li>\r\n                            <li>Past en kan naast andere relaties, zelfs meerder sugarrelaties</li><li>Leg ook zakelijke relaties aan via je sugardate</li><li>Openheid van je partner geeft je insite</li><li>Verdien <strong><em>meer</em></strong> dan gemiddelde maandsalaris!</li>\r\n                        </ul>', '<ul>\r\n                             <li><strong><em>Flexible</em></strong> and when it suits you!</li>\r\n                             <li>A regular dating partner of your choice</li>\r\n                             <li>Free in what you do and don\'t want to do through pre-agreed frameworks</li>\r\n                             <li>Make money with good food and exciting nightlife</li>\r\n                             <li><strong><em>Fun</em></strong>&nbsp;( unexpected <strong><em>extras</em></strong> from your sugardaddy or -mommy</li>\r\n                             <li>Fits and can, in addition to other relationships, even multiple sugar relationships</li><li> Also establish business relationships through your sugar date</li><li>Openness of your partner gives you insite</li><li>Earn <strong><em>more</em></strong> than average monthly salary!</li>\r\n                         </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
