(2061, 'home_what_alt', 'y', 1638891603, 0, 1638891603, 0, 'n', NULL, NULL, 'De meest bekende suikerrelatie is wel die van sugar babe en sugar daddy, ook wel suikeroom en suikernichtje genoemd. Er zijn echter andere combinaties denkbaar. Zo kan een sugar mommy een sugar guy zoeken. Bovendien hoeft een relatie niet perse een heteroseksuele suikerrelatie te zijn. Een sugar daddy kan een sugar guy zoeken en een sugar mommy een sugar babe. Alle combinaties zijn mogelijk. Een sugar daddy die een sugar babe en een sugar guy heeft is ook een optie of wat dacht je van sugar parent (suikerouders) waar een koppel een suikernichtje of suikerneefje onder hun hoeden neemt. Zoveel mensen, zoveel wensen. Respecteer elkaar hierin en dwing niemand niet in een relatie waar ze zich niet in thuis voelen. Het is niet leuk voor die persoon en uiteindelijk ook niet voor jou.', 'The most famous sugar relationship is that of sugar babe and sugar daddy, also known as sugar daddy and sugar niece. However, other combinations are conceivable. For example, a sugar mommy can find a sugar guy. Moreover, a relationship does not necessarily have to be a heterosexual sugar relationship. A sugar daddy can find a sugar guy and a sugar mommy a sugar babe. All combinations are possible. A sugar daddy who has a sugar babe and a sugar guy is also an option or how about sugar parent where a couple takes a sugar niece or sugar cousin under their hats. So many people, so many wishes. Respect each other in this and don\'t force anyone into a relationship they don\'t feel at home in. It\'s not fun for that person and ultimately not for you either.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2062, 'home_what_title', 'y', 1638891807, 0, 1638891807, 0, 'n', NULL, NULL, 'Wat is Sugar dating?', 'What is Sugar dating?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2063, 'home_what_text', 'y', 1638891807, 0, 1638891807, 0, 'n', NULL, NULL, 'De meest bekende sugarrelatie is wel die van sugarbabe en sugardaddy, ook wel suikeroom en suikernichtje genoemd. Er zijn echter andere combinaties denkbaar. Zo kan een sugarmommy een sugarguy zoeken. Bovendien hoeft een relatie niet perse een heteroseksuele te zijn. Een sugarddaddy kan een sugarguy zoeken en een sugarmommy een sugarbabe. Alle combinaties zijn mogelijk. Een sugardaddy die een sugarbabe en een sugarguy heeft is ook een optie. Zoveel mensen, zoveel wensen. Respecteer elkaar hierin en dwing iemand niet in een relatie waar ze zich niet in thuis voelen. Het is niet leuk voor die persoon en uiteindelijk ook niet voor jou.', 'The most famous sugar relationship is that of sugarbabe and sugardaddy, also known as sugar daddy and sugar niece. However, other combinations are conceivable. For example, a sugar mommy can look for a sugar guy. Moreover, a relationship does not necessarily have to be a heterosexual one. A sugarddaddy can find a sugarguy and a sugarmommy a sugarbabe. All combinations are possible. A sugardaddy who has a sugarbabe and a sugarguy is also an option. So many people, so many wishes. Respect each other in this and don\'t force someone into a relationship they don\'t feel at home in. It\'s not fun for that person and ultimately not for you either.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
