(2660, 'yes_cookies', 'y', 1646141765, 0, 1646141765, 0, 'n', NULL, NULL, 'Ja, we moeten ook cookies gebruiken. Maar we gebruiken ze niet om u te volgen of om u persoonlijke advertenties te geven. Nee, we gebruiken ze voor uw login en aankoop. Dus niets bijzonders om je de beste browserervaring te bieden die we kunnen bieden.&nbsp;<br><br>Als je meer wilt weten over hoe we met je gegevens omgaan, lees dan ons privacybeleid of voor nog meer informatie onze Algemene voorwaarden.', 'Yes we need to use cookies as well. But we don\'t use them to track you or give you personal advertising. No we use them for your login and purchase. So nothing special just to give you the best browser experience we can offer.&nbsp;<br><br>If you wanna know more about how we handel your data please read our privacy policy or for even more information our Terms and Conditions.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
