(2666, 'privacy_policy_data', 'y', 1646141765, 0, 1646141765, 0, 'n', NULL, NULL, 'We willen geen persoonlijke gegevens van u verzamelen en we zullen u dan ook niet als individu volgen. We slaan gegevens op over welke pagina\'s worden bezocht volledig anoniem, zodat we onze dienstverlening kunnen verbeteren. We willen geen geld verdienen met uw persoonsgegevens! Dit zijn uw gegevens waarom zouden wij daar achter uw rug om geld aan gaan verdienen, dat is niet eerlijk vinden wij. Wij gebruiken deze alleen om u de gemakkelijkste en beste ervaring te bieden die u kunt hebben op ons platform.<br><br>Als u meer wilt weten over onze privacybeleid leest u ook onze Algemene voorwaarden. Hierin kunt u lezen dat wij al uw gegevens behandelen zoals de EU vast heeft gesteld in de AVG wetgeving. Uw persoonsgegevens zijn dus veilig opgeslagen</p>', 'We do not want to collect any personal information from you and we will not track you as an individual. We store data about which pages are visited completely anonymously, so that we can improve our services. We don\'t want to make money with your personal data! This is your data why should we start earning money behind your back, we don\'t think that\'s fair. We only use it to provide you with the easiest and best experience you can have on our platform.<br><br>To learn more about our privacy policy, please read our Terms and Conditions. In this you can read that we treat all your data as the EU has established in the AVG legislation. Your personal data is therefore stored securely </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2667, 'build_portfolio', 'y', 1646141765, 0, 1646141765, 0, 'n', NULL, NULL, 'Bouw jouw portfolio', 'Build your portfolio', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2668, 'model_portfolio', 'y', 1646141765, 0, 1646141765, 0, 'n', NULL, NULL, 'Fotografen willen weten wat je capaciteiten zijn als model en modellen willen weten hoe ze ermee aan de slag gaan. <br><br>Dus bouw een portfolio op met foto\'s van jezelf als model en als fotograaf bouw je je portfolio uit met werken die je hebt gemaakt.&nbsp;', 'Photographers wanna know your abilities as a model and models wanna know how they are going to work with. <br><br>So build a portfolio with photos of yourself as a model and as a photographer you build your portfolio out with works you made.&nbsp;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
