(2817, 'how_Browse_and_post_text', 'y', 1649079420, 0, 1649079420, 0, 'n', NULL, NULL, 'Als fotograaf kun je beginnen met het doorzoeken van alle modellen. Fotografen en modellen e.d. kunnen hun opties direct op de marktplaats vinden. <br><br>Plaats uw beschikbaarheid als model in jouw perssonlijke agenda en blader door de marktplaats heen voor vacatures die bij jou passen.<br>', 'As a photographer you can start browsing models. Photographers and models a like can directly post there options on the market place. <br><br>Place your availabilty in your agenda as a model and browse the market place for jobs nearby.<br>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2818, 'how_expand_portfolio', 'y', 1649079420, 0, 1649079420, 0, 'n', NULL, NULL, 'Breid je portfolio uit', 'Expand the portfolios', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2820, 'how_expand_portfolio_text', 'y', 1649079462, 0, 1649079462, 0, 'n', NULL, NULL, 'Als je samen een contract hebt en de shoot is geweest dan kan de opdrachtgever er voor keizen om de foto\'s te uploaden naar Model Agenge. <br><br> Als model of fotograaf geef je eenvoudig akkoord en staan ze direct in je portfolio van Model Agency.', 'If in the contract is agreed that the model can use the image for her or his portfolio the photographer can upload the photos to the Model Agency and share it with the model.<br><br>If the model want she or he can approve and place in one click in the portfolio.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2821, 'how_after_shoot', 'y', 1649079463, 0, 1649079463, 0, 'n', NULL, NULL, 'Na de fotoshoot', 'After the shoot', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2823, 'how_more_things', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Maar er zijn meer meer opties!', 'But there is more things you can do!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2824, 'how_favorites', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Favorieten', 'Favorites', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2825, 'how_favorites_text', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Je kunt mensen aan je favorieten teovoegen. Zo vind je makkelijk je ideale model of fotograaf terug op Model Agnecy', 'You can add people to your favorites. This way it makes it easier to find your ideal model or photographer back on Model Agency', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2826, 'how_book_photographer', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Boek een fotograaf', 'Book a photographer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2827, 'how_book_photographer_text', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Indien u een project heeft kunt u ook een fotograaf en de modellen boeken. Dus ben je projectmanager, regisseur of wil je gewoon je idee realiseren. Je kunt het hier laten gebeuren', 'If you have a project you can also book a photographer en the models. So if your a project manager, director or just want to make your idea reality. You can make it happen here', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
