(2829, 'how_public_portfolio_text', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Als model of fotograaf kun je een openbaar portfolio maken. Dit betekent dat iedereen in de wereld ook zonder account dat deel van je portefeuille kan zien.', 'As a model or photographer you can create a public portfolio. This means that everyone in the world also without an account can see that part of your portfolio.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
