(2831, 'how_notifications_text', 'y', 1649079527, 0, 1649079527, 0, 'n', NULL, NULL, 'Als u op zoek bent naar speciale mensen om voor u te modelleren, kunt u waarschuwingen plaatsen bij de beschrijvingen die u opgeeft. Ook zodra er een match is van minimaal 70% krijg je een melding per e-mail', 'If your looking for some special people to model for you, you can put alerts on the descriptions you give up. Als soon as there is a match of at least 70% you will get a notification by email', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
