(2975, '100_for_life_title', 'y', 1655927408, 0, 1655927408, 0, 'n', NULL, NULL, 'Krijgen een Levenslang GRATIS Abonnement!', 'Get a Lifetime Subscription for FREE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2976, '100_for_life_text', 'y', 1655927408, 0, 1655927408, 0, 'n', NULL, NULL, '<p><strong>Ja, je leest het goed: wij geven 100 lifetime abonnementen weg aan de eerste honderd mensen die zich aanmelden op ons nieuw vormgegeven platform.</strong></p><p><h2><strong>Wat moet je doen</strong></h2>Eigelijk heel simpel: registreer nu, en als je een van de eerste honderd bent, zetten we jouw gekozen abonnement om naar een lifetime gratis abonnement. Natuurlijk stellen we je hierover op de hoogte!</p><p><h2><strong>Je krijgt je registratiekosten van ons terug.</strong></h2> Je krijgt van ons je registratiekosten terug. Als je je registreert, moet je de eerste maand van je nieuwe abonnement betalen. Dit geldt ook voor de eerste 100 aanmeldingen. Dit is nodig om een aantal zaken te controleren. Zo controleren we of je een echt persoon bent en geen bot, en voeren we nog meer uit achter de schermen om jouw account in orde te maken. Hoe dan ook betalen wij dit bedrag natuurlijk terug - anders zou het niet gratis zijn. Zodra wij je abonnement omzetten schrijven we deze abonnementskosten bij op je online portemonnee. Hierdoor is je lifetime subscription ook echt <strong>voor de rest van je leven</strong> volledig gratis!</p><p><h2><strong>Spelregels</strong></h2>Zoals bij elk spel zijn er een aantal regels waar iedereen zich aan moet houden. Ten eerste zijn onze algemene voorwaarden van toepassing. Hiermee ga je akkoord tijdens je registratie. We willen het voor de zekerheid nogmaals vernoemd hebben. Verder gelden de volgende regels:</p><ul>\r\n<li>Je mag je maar met Ã©Ã©n account inschrijven. Komen we er achter dat je toch met meerdere accounts meedoet aan deze actie, zullen we al jouw accounts terug zetten naar het eerder gekozen abonnement.</li>\r\n<li>Als je niet actief bent na 3 maanden van registratie behoudt Model Agency het recht om je uit te schrijven van de toegekende lifetime subscription.</li>\r\n<li>Bij misbruik van het account kan het team van Model Agency zonder enige communicatie of waarschuwingen besluiten het account uit te schrijven van een lifetime gratis abonnement of zelfs over te gaan op volledige verwijdering van het platform</li>\r\n<li>Overige betalingen binnen het platform blijven betaald en zijn niet vrijgesproken doormiddel van het lifetime gratis abonnement.</li></ul></p><div class=\"mbr-section-btn\"><button class=\"btn btn-primary display-4 trigger-register\" >Nu registreren!</button></div>', '<p><strong>Yes, you read that correctly: we are giving away lifetime subscriptions to the first hundred people who register on our newly designed platform.</strong></p><p><h2><strong>What do you need do</strong></h2>It\'s actually quite simple: register now, and if you are one of the first hundred subscribers, we will convert your chosen subscription to a lifetime free subscription. Of course, we\'ll inform you about this!</p><p><h2><strong>You will get your registration costs back</strong></h2> We will restitute your registration costs. When you register your account, you need to pay for the first month of your new subscription. This also applies to the first 100 registrations. This is required to check a few things. For example, we\'ll check if you are a real person and not a bot, and there\'s more we\'ll take care of behind the scenes to prepare your account. In any case, of course we\'ll refund these costs, otherwise your subscription would not be free. As soon as we convert your subscription, we will credit these subscription costs to your online wallet. This way, your lifetime subscription will be completely free <strong>for the rest of your life!</strong></p><p><h2>Rules of the game</h2>As with any game, there are a number of rules that everyone adheres to. Firstly, our general terms and conditions apply. You agree to this during your registration. We just want to mention it again just to be sure. The following rules also apply:</p><ul>\r\n<li>You can only register with one account. If we find out that you participate in this promotion with multiple accounts, we will reset all your accounts to the previously chosen subscription.</li>\r\n<li>If you are not active after 3 months of registration, Model Agency reserves the right to unsubscribe from the assigned lifetime subscription.</li>\r\n<li>In case you abuse your account, the Model Agency team may decide, without any communication or warnings, to unsubscribe the account from a lifetime free subscription or even completely remove the account from the platform</li>\r\n<li>Other payments within the platform remain paid and are not exempted by the lifetime free subscription.</li>\r\n</ul><div class=\"mbr-section-btn\"><div class=\"btn btn-primary display-4 trigger register\" >Register now!</div></div>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
