INSERT INTO `tos_description` (`id`, `tos_id`, `language`, `name`, `title`, `description`, `short_description`, `meta_description`, `keywords`, `add_date`, `add_user`, `update_date`, `update_user`) VALUES
(1, 1, 'en', 'Use of uploaded photos', 'Use of uploaded photos', 'All photos uploaded to the model-agency.online platforms may be used on any model-agency.online platform in any form the organization deems desirable. If a photo has been used improperly and it is not included in the terms and conditions of the model-agency.online platforms, you can contact us about this by means of the contact form on one of the model-agency.online websites. Please mention which photo it concerns, on which page it is used and why the publication would be incorrect. If one of these is missing, we cannot correspond further about this.', '', '', '', 1653903555, 0, 1653903555, 0),
(2, 2, 'en', 'Use of photoâs outside our platforms', 'Use of photoâs outside our platforms', 'If your photos are featured elsewhere than the platforms of model-agency.online, model-agency.online is not liable for this and model-agency.online will not correspond further with the parties involved. All photos published on any of the model-agency.online platforms are provided with metadata and a watermark. We hereby indicate visibly and invisibly that the images belong to model-agency.online.\r\n', '', '', '', 1653903555, 0, 1653903555, 0),
(3, 3, 'en', 'Photo check', 'Photo check', 'Photos used for avatars, covers for photo albums, public photo albums, on the wall and public diaries will be checked for nudity, inappropriate expressions and authenticity. The organization of model-agency.online therefore reserves the right to reject and remove any image without further explanation or communication about the decision. This could also concern photos that are private or hidden.', '', '', '', 1653903555, 0, 1653903555, 0),
(4, 4, 'en', 'Portrait right', 'Portrait right', 'Images uploaded to a model-agency.online platform may be used by model-agency.online at any time to display on the model-agency.online platforms. The person hereby relinquishes the portrait rights and copyrights to the organization of model-agency.online. If an image is removed from the platform by the user, the portrait rights and copyrights will again be in the hands of the person who uploaded it. For photos that have been used for promotional purposes and outside the user\'s profile, the organization will draw up a separate contract for use after removal of the photo.', '', '', '', 1653903555, 0, 1653903555, 0),
(5, 5, 'en', 'Use of personal data', 'Use of personal data', 'All personal data provided to model-agency.online may be used by the organization on the model-agency.online platforms. This personal data will never be shared with other users of the platform. The organization stores personal data encrypted in databases managed only by the organization of model-agency.online. The organization of model-agency.online reserves the right to share personal data with other projects within the organization of model-agency.online. These organizations may be wholly or partially controlled by the model-agency.online organization or may be a subsidiary of the model-agency.online organization\'s holding company.', '', '', '', 1653903555, 0, 1653903555, 0),
(6, 6, 'en', 'Use of address details', 'Use of address details', 'When passing on address details, the organization, the partners of the organization and the holding and subsidiaries of the holding of model-agancy.online may use and process the data for the purpose of providing you with correct lawful information about orders made by you or about orders placed by other members of one of the platforms of model-agency.online, the partners of model-agency.online or the holding and subsidiaries of model-agency.online. To guarantee your privacy, the organization, all the partners and the holding and subsidiaries of the holding of model-agency.online have a confidentiality statement that clearly states for what purpose the partner or the holding or subsidiaries of the holding of model-agency.online may use the address for. The organization will therefore never give your address details to other members of any platform within the organization, the partners of the organization or the holding company or subsidiaries of the holding company of model-agency.online. If your address details are removed, the use of the address by our partners and the holding and subsidiaries of model-agency.online will also be cancelled. The organization of model-agency.online reserves the right to store your address details within backups for up to 6 months after entering your address.', '', '', '', 1653903555, 0, 1653903555, 0),
(7, 7, 'en', 'MO financial services', 'MO financial services', 'MO financial services takes care of the payments within the model-agency.online platforms on behalf of model-agency.online. They have the right to process your personal data that are necessary to make the payments. Payments made through MO financial services cannot be traced back to the services of model-agency.online and will only take place within secure environments in collaboration with Mollie, who makes the final payment for MO financial services.', '', '', '', 1653903555, 0, 1653903555, 0),
(8, 8, 'en', 'Mollie', 'Mollie', 'Mollie is the payment provider of MO financial services and is part of Stichting Mollie payments. Mollie is known under the creditor ID NL08ZZZ502057730000. More information about Mollie can be found on the Mollie website: <a href = \'https://www.mollie.com\' target=\'_blank\'>https://www.mollie.com</a>', '', '', '', 1653903555, 0, 1653903555, 0),
(9, 9, 'en', 'Reclaims', 'Reclaims', 'If you have subscribed to one of the model-agency.online platforms, you have agreed to pay for the service of one of the model-agency.online platforms. The subscription can be canceled before every 20th of the month. Refund for the last month is only possible by written request through the contact form on the website of the relevant platform of model-agency.online. Requesting a refund older than 30 days is unfortunately not possible and will not be recognized if any activity has been carried out on the relevant platforms of model-agency.online. Activities are: uploading an avatar, posting a message on a wall, commenting on a wall post, chatting with other users of the model-agency.online platforms, uploading an image and/or an entry in a diary. If one or more activities have been carried out, we see this as use of the platform and the organization of model-agency.online reserves the right to refuse the refund.', '', '', '', 1653903555, 0, 1653903555, 0),
(10, 10, 'en', 'Canceling your subscription', 'Canceling your subscription', 'Any subscription with one of the model-agency.online platforms can be canceled before the 20th of the month through the personal dashboard which you will see immediately after you have logged in. Termination of the subscription in any other way on one of the platforms of model-agency.online is not allowed and may have legal consequences if the organization of model-agency.online chooses to do so. If it is no longer possible for you to log in and you still want to cancel your subscription, you can contact the organization of model-agency.online through the contact form on the relevant platform. If you contact us, please do so with the email address used on the account for which you want to end the subscription and clearly state your username and that you want to end your subscription. If you have multiple subscriptions on different platforms, you will have to terminate them individually.', '', '', '', 1653903555, 0, 1653903555, 0),
(11, 11, 'en', 'Payments', 'Payments', 'The model-agency.online platforms use SEPA direct debit, credit card, iDeal, Bancontact, EPS, Giropay, Przelewy24, Belfius Direct Net payments through MO financial services and Mollie. The organization does not have to grant access to any of model-agency.online\'s platforms, perform the service or deliver the product if a payment is unsuccessful. If a SEPA direct debit cannot be paid, the organization of model-agency.online reserves the right to recover the costs incurred for this from the user and to stop all services and products within the model-agency.online platforms. The costs for this are â¬15 for a failed SEPA direct debit and â¬7.50 administration costs plus the costs of the subscription. If a payment is not made, the organization of model-agency.online reserves the right to send a first reminder with an increase of â¬7.50 and a second reminder with a new increase of â¬7.50. With a third reminder, the invoice is transferred to a debt collection agency that also charges costs. If you make a payment, you commit to a payment obligation with the organization of model-agency.online.', '', '', '', 1653903555, 0, 1653903555, 0),
(12, 12, 'en', 'Increase of subscription costs', 'Increase of subscription costs', 'The organization of model-agency.online reserves the right to increase the subscription costs at least one month prior to the debit at any time. The increase of subscription costs will not be communicated further. There is no limit to any increases of the subscription costs of the model-agency.online platforms.', '', '', '', 1653903555, 0, 1653903555, 0),
(13, 13, 'en', 'Use of contact details', 'Use of contact details', 'Passing on personal contact details is at the user\'s own risk. Personal contact details can only be transferred through our chat and messenger service. Mentioning contact details within your profile is not allowed. The organization may block and cancel your account without further communication if we detect the mention of contact details.', '', '', '', 1653903555, 0, 1653903555, 0),
(14, 1, 'nl', 'Gebruik van geÃ¼ploade foto\'s', 'Gebruik van geÃ¼ploade foto\'s', 'Alle foto\'s die zijn geÃ¼pload op de platformen van model-agency.online mogen gebruikt worden op elk platform van model-agency.online in elke vorm die de organisatie wenselijk vindt. Is een foto ten onrechte gebruikt en valt dit buiten de voorwaarden van de platformen van model-agency.online, dan kan hier contact over worden opgenomen door middel van het contactformulier op een van de websites van model-agancy.online. Vermeld hierbij om welke foto het gaat, op welke pagina deze wordt gebruikt en wat de reden zou zijn van een onterechte publicatie. Mist een van deze onderdelen, dan kunnen wij hier niet verder over corresponderen.', '', '', '', 1653903555, 0, 1653903555, 0),
(15, 2, 'nl', 'Fotogebruik buiten onze platformen', 'Fotogebruik buiten onze platformen', 'Als uw foto\'s ergens anders te zien zijn dan de platformen van model-agency.online, dan is model-agency.online hier niet voor aansprakelijk en zal model-agency.online hier ook niet verder over corresponderen met de betrokken partijen. Alle fotoâs die worden gepubliceerd op een van de platformen van model-agency.online zijn voorzien van metadata en een watermerk. Hierbij geven wij zichtbaar en onzichtbaar kenbaar dat het beeldmateriaal aan model-agency.online toebehoort.', '', '', '', 1653903555, 0, 1653903555, 0),
(16, 3, 'nl', 'Fotocontroles', 'Fotocontroles', 'Fotoâs die worden gebruikt als avatar/schermafbeelding, als cover voor fotoalbums, in publieke fotoalbums, op de wall en in publieke dagboeken worden gecontroleerd op naaktheid, ongepaste uitingen en echtheid. De organisatie van model-agency.online behoudt zich dan ook het recht om elke afbeelding af te keuren en te verwijderen zonder verdere toelichting of communicatie over de beslissing. Dit kan ook foto\'s betreffen die op privÃ© of op verborgen staan.', '', '', '', 1653903555, 0, 1653903555, 0),
(17, 4, 'nl', 'Portretrecht', 'Portretrecht', 'Afbeeldingen die worden geÃ¼pload naar een platform van model-agency.online mogen door model-agency.online te allen tijde worden weergegeven op de platformen van model-agency.online. Hierbij staat de persoon de portret- en auteursrechten af aan de organisatie van model-agency.online. Als een gebruiker de afbeelding van het platform verwijdert, zijn de portret- en auteursrechten weer in de handen van de persoon die de afbeelding heeft geÃ¼pload. Voor foto\'s die zijn gebruikt voor promotiedoeleinden en buiten het profiel van de gebruiker stelt de organisatie een apart contract op voor gebruik na verwijdering van de foto.', '', '', '', 1653903555, 0, 1653903555, 0),
(18, 5, 'nl', 'Gebruik van persoonsgegevens', 'Gebruik van persoonsgegevens', 'Alle persoonsgegevens aangegeven bij model-agency.online mogen door de organisatie van model-agency.online worden gebruikt op de platformen van model-agency.online. Deze persoonsgegevens zullen nooit gedeeld worden met andere gebruikers van het platform. De organisatie slaat persoonsgegevens versleuteld op in de databases die alleen in beheer zijn van de organisatie van model-agency.online. De organisatie van model-agency.online behoudt zich wel het recht om persoonsgegevens te delen met andere projecten binnen de organisatie van model-agency.online. Deze organisaties kunnen volledig of gedeeltelijk in beheer zijn van de organisatie van model-agency.online of een dochteronderneming zijn van de holding van de organisatie van model-agency.online', '', '', '', 1653903555, 0, 1653903555, 0),
(19, 6, 'nl', 'Gebruik van adresgegevens', 'Gebruik van adresgegevens', 'Bij het doorgeven van adresgegevens mogen de organisatie, de partners van de organisatie en de holding en dochterondernemingen van de holding van model-agency.online de gegevens gebruiken en verwerken ter doelstelling om u te voorzien van de juiste rechtmatige gegevens over door u gedane bestellingen of voor bestellingen gedaan door andere leden van een van de platformen van suagerdating.online, de partners van model-agency.online of de holding en de dochterondernemingen van model-agency.online. Om uw privacy te waarborgen hebben wij met alle partners van de organisatie van model-agency.online en de holding en de dochterondernemingen van de holding van model-agency.online een geheimhoudingsverklaring waarin duidelijk staat opgenomen waarvoor de partner of de holding of dochterondernemingen van de holding van model-agency.online het adres mag gebruiken. De organisatie zal uw adresgegevens dan ook nooit geven aan andere leden van welk platform dan ook binnen de organisatie, de partners van de organisatie of de holding of dochterondernemingen van de holding van model-agency.online. Bij het verwijderen van uw adresgegevens komt ook het gebruik van het adres bij onze partners en de holding en de dochterondernemingen van model-agancy.online te vervallen. De organisatie van model-agency.online behoudt zich wel het recht voor om tot 6 maanden na opgeven van uw adres uw adresgegevens te bewaren binnen back-ups.', '', '', '', 1653903555, 0, 1653903555, 0),
(20, 7, 'nl', 'MO financial services', 'MO financial services', 'MO financial services verzorgt namens model-agency.online de betalingen binnen de platformen van model-agency.online. Zij hebben het recht hierbij uw persoonsgegevens te verwerken die nodig zijn om de betalingen tot stand te brengen. Betalingen gedaan via MO financial services zullen niet te herleiden zijn naar de diensten van model-agency.online en zullen alleen plaatsvinden binnen beveiligde omgevingen in samenwerking met Mollie, die de uiteindelijke betaling voor MO financial services verricht.', '', '', '', 1653903555, 0, 1653903555, 0),
(21, 8, 'nl', 'Mollie', 'Mollie', 'Mollie is de betalingsprovider van MO financial services en onderdeel van Stichting Mollie payments. Mollie is bekend onder de incassant ID NL08ZZZ502057730000. Meer informatie over Mollie kunt u vinden op de website van Mollie: <a href = \'https://www.mollie.com\' target=\'_blank\'>https://www.mollie.com</a>', '', '', '', 1653903555, 0, 1653903555, 0),
(22, 9, 'nl', 'Teruggaven', 'Teruggaven', 'Als u een abonnement hebt afgesloten op een van de platformen van model-agency.online bent u akkoord gegaan met een betaling voor de service van een van de platformen van model-agency.online. Het abonnement is op te zeggen voor elke twintigste van de maand. Teruggave over de laatste maand kan alleen op schriftelijk verzoek via het contactformulier op de website van het desbetreffende platform van model-agency.online. Verzoek voor een terugbetaling ouder dan 30 dagen is helaas niet mogelijk en zal ook niet worden herkend als er enige activiteit is verricht op het desbetreffende platform van model-agency.online. Activiteiten zijn: het uploaden van een avatar, het plaatsen van een bericht op een wall, een reactie op een wall post, chatten met andere gebruikers van de platformen van model-agency.online, het uploaden van een afbeelding en/of een entry in een dagboek. Als een of meerdere activiteiten zijn uitgevoerd zien wij dit als gebruik van het platform en behoudt de organisatie van model-agency.online zich het recht voor om de terugbetaling te weigeren.', '', '', '', 1653903555, 0, 1653903555, 0),
(23, 10, 'nl', 'Abonnement beÃ«indigen', 'Abonnement beÃ«indigen', 'Elk afgesloten abonnement bij een van de platformen van model-agency.online kan voor de twintigste van de maand worden beÃ«indigd via het persoonlijke dashboard dat u direct te zien krijgt na het inloggen. BeÃ«indiging van het abonnement op welke andere wijze dan ook op een van de platformen van model-agency.online is niet toegestaan en kunnen juridische gevolgen hebben als de organisatie van model-agency.online hiervoor kiest. Is het niet meer mogelijk om in te loggen en wilt u toch uw abonnement beÃ«indigen, dan kunt u contact opnemen met de organisatie van model-agency.online via het contactformulier van het desbetreffende platform. Als u contact opneemt, doe dit dan met het gebruikte e-mailadres van het account waarvan u het abonnement wilt beÃ«indigen. Vermeld hierbij duidelijk uw gebruikersnaam en dat u uw abonnement wilt beÃ«indigen. Heeft u meerdere abonnementen lopen op verschillende platformen, dan zult u deze ieder individueel moeten beÃ«indigen.', '', '', '', 1653903555, 0, 1653903555, 0),
(24, 11, 'nl', 'Betalingen', 'Betalingen', 'De platformen van model-agency.online maken gebruik van SEPA-incasso, creditcard, iDeal, Bancontact, EPS, Giropay, Przelewy24, Belfius Direct Net betalingen via MO financialservice en Mollie. Als een betaling niet slaagt hoeft de organisatie geen toegang te verlenen tot een van de platformen van model-agency.online of de dienst uit te voeren of product te leveren. Als een SEPA-incasso niet voldaan kan worden kan de organisatie van model-agancy.online zich het recht behouden de gemaakte kosten hiervoor terug te halen bij de gebruiker en alle diensten en producten te stoppen binnen de platformen van model-agency.online. De kosten hiervoor bedragen â¬15 voor een mislukte SEPA-incasso en â¬7,50 administratie kosten plus de kosten van het afgesloten abonnement. Als een betaling niet wordt voldaan behoudt de organisatie van model-agency.online zich het recht om een eerste herinnering te sturen met een verhoging van â¬7,50 en een tweede herinnering met een nieuwe verhoging van â¬7,50. Bij een derde herinnering wordt de factuur overgedragen aan een incassobureau die ook weer kosten in rekening brengt. Als u een betaling aangaat verplicht u zich tot een betalingsverplichting bij de organisatie van model-agency.online.', '', '', '', 1653903555, 0, 1653903555, 0),
(25, 12, 'nl', 'Verhoging abonnementskosten', 'Verhoging abonnementskosten', 'De organisatie van model-agency.online behoudt zich het recht voor om te allen tijden de abonnementskosten minimaal Ã©Ã©n maand voorafgaand aan de afschrijving te verhogen. Over verhogingen vindt geen verdere communicatie plaats. Eventuele verhogingen van de abonnementskosten van de platformen van model-agency.online kennen geen limiet.', '', '', '', 1653903555, 0, 1653903555, 0),
(26, 13, 'nl', 'Gebruik van contactgegevens', 'Gebruik van contactgegevens', 'Het doorgeven van persoonlijke contactgegevens is op eigen risico van de gebruiker. Persoonlijke contactgegevens kunnen alleen via onze chat en messenger service worden overgedragen. Het vernoemen van contactgegevens binnen uw profiel is niet toegestaan. Als wij als organisatie het vernoemen van contactgegevens detecteren mogen wij zonder verdere communicatie uw account blokkeren en opheffen.', '', '', '', 1653903555, 0, 1653903555, 0),
(27, 14, 'en', 'Company details', 'Company details', '<p>model-agency.online is a trade mark of Merwin Online, registered at chamber of commerce in Rotterdam, the Netherlands under number: 58047174.</p><p>Model-agency is located at the head office of Merwin Online:</p><p>Merwin Online<br>model-agency.online<br>Tollensstraat 96b<br>3035 NM Rotterdam<br>The Netherlands<br><br>+31 (0)10 84 03 989<br><a href = \'https://merwin.online\' target =\'_blank\'>https://merwin.online</a></p>', '', '', '', 1653903555, 0, 1653903555, 0),
(28, 14, 'nl', 'Bedrijfsgegevens', 'Bedrijfsgegevens', '<p>model-agency.online is een handelsnaam van Merwin Online, geregistreerd bij de Kamer van Koophandel te Rotterdam, Nederland onder nummer: 58047174.</p><p>Model-agency is gevestigd  bij het hoofdkantoor van Merwin Online:</p><p>Merwin Online<br>model-agency.online<br>Tollensstraat 96b<br>3035 NM Rotterdam<br>Nederland<br><br>+31 (0)10 84 03 989<br><a href = \'https://merwin.online\' target =\'_blank\'>https://merwin.online</a></p>', '', '', '', 1653903555, 0, 1653903555, 0),
(29, 16, 'en', 'Disputes', 'Disputes', '<p>[[companyname]] has a monthly payout period. Every last Friday of the month with the exception if the last Friday of the month is a national holiday according to the Dutch or Thai calendar and will then make the Friday there for the monthly payments. For payouts from [[companyname]], a minimum amount of &euro;[[pay_out_minimum_amount]]. Payments from [[companyname]] only take place via bank transfer and PayPal and will always be in Euro\'s. [[companyname]] reserves the right to suspend payment if necessary information from the user is missing such as: Full name according to passport, current and complete residential address as known to the government of the country of residence, complete and correct bank details. If it turns out that one or more of the aforementioned information is not known, is incomplete or incorrect, [[companyname]] reserves the right to suspend payment until all information is correct. [[companyname]] is not obliged to inform the user about missing information. After logging in to the [[companyname]] website, all data can be entered and corrected via the dashboard, and prifile settings and the financial page. For payouts [[companyname]] will request a fee, the costs of the fee is &euro;[[pay_out_cost]] the fee is deducted from the total amount that will be transfered.</p><p>[[companyname]] also offers the possibility to request a payout early via the dashboard of [[companyname]]. You can reach this via the dashboard and then go to finances. An early payout can only take place if all information mentioned above is complete and correct. If this information is not correct or complete, [[companyname]] reserves the right to reject the premature payment without notice to the user. A prepayment can only be requested with a minimum of &euro;[[prepayment_minimum_amount]] and at a cost of &euro;[[prepayment_cost]]. These are deducted from the total amount to be paid out. [[companyname]] reserves the right to reject an advance payment at any time without reason or informing of the user.</p><p>[[companyname]] is not responsible for any delays in payments caused by inability, lack of personnel, bank and authorities or other outside influences. It is also not possible to communicate about this with [[companyname]]. Withdrawals can only be made via bank transfer and PayPal and only in Euros. Costs for converting to other currencies are passed on to the recipient. Any other costs charged by a bank or authority will be passed on by [[companyname]] to the reseaver and may be deducted from the total amount or will be deducted from the users wallet.</p><p>[[companyname]] is obliged to note any changes to the user\'s online wallet, report and clarify. These can also be found if you log in to the [[companyname]] website and then go to the finance page and then history. The history is kept for a maximum of 7 years. This data may be deleted by [[companyname]] when the account is terminated and closed. [[companyname]] reserves the right to refuse or cancel a transfer at any time without further notification to the user.</p>', 'Disputes about a cooperation', 'Disputes about a cooperation', '<p>A dispute can be opened up to [[contract_pay_out_time]] days after the end of the contract. Disputes can only be opened about contracts that have been fully completed and signed. [[CompanyName]] will take care of the dispute and inform both parties about what is going on and possibly act accordingly if [[CompanyName]] sees a clear solution and make a statement about it. [[CompanyName]] can also choose to refer the dispute to a legal authority. Any costs for this are for the party that opened the dispute and can possibly be recovered from the party that is not in the right. [[CompanyName]] will notify both parties prior to taking any legal action. If it comes to legal conflict, [[CompanyName]] cannot be held liable and the conflict will be governed by Dutch law.</p><p>If you wish to open a dispute against [[CompanyName]], you can do so via the <a href = \'\'./contact>contact form</a> on the [[CompanyName]] website. We will handle your dispute with care and look for a solution. In the event of a dispute, we will always consult a lawyer in order to act in accordance with the law.</p>', 1655819138, 0, 1655819138, 0),
(30, 16, 'nl', 'Geschillen', 'Geschillen', '<p>Er kan een geschil geopend worden to [[contract_pay_out_time]] dagen na het einde van het contract. Er kunnen alleen geschillen geopend worden over contracten die volledig zijn ingevuld en getekend.[[CompanyName]] zal zorgdragen over het geschil en beide partijen informeren over wat er gaan de is en eventueel als [[companyname]] een duidelijke oplossing ziet hier naar handelen en een uitspraak over doen. [[companyname]] kan er ook voor kiezen om het geschil door te zetten naar een juridische instantie. Eventuele kosten zijn hiervoor zijn voor de partij die het geschil hebben geopend en kunnen eventueel verhaald worden bij de partij die niet in het gelijk is gesteld. [[companyname]] zal voordat er juridische stappen worden genomen hiervan beide partijen op de hoogte stellen. Als het tot juridische conflict komt, kan [[companyname]] niet aansprakelijk worden gesteld en verloopt het conflict bij Nederlandse wetgeving.</p><p>Mocht u een geschil tegen [[companyname]] willen openen kunt u dit doen via het <a href = \'\'./contact>contact formulier</a> op de website van [[companyname]]. Wij zullen uw geschil met zorg behandelen en zoeken naar een oplossing. Wij zullen bij een geschil altijd raad vragen bij een jurist om zo volgens de wetgeving te handelen.</p>', 'Schillen over samenwerkingen', 'Schillen over samenwerkingen', '', 1655457202, 0, 1655457202, 0),
(31, 17, 'nl', 'Wallet', 'Wallet', '<p>De wallet binnen het platform van [[companyname]] is vergelijkbaar met het saldo op een bankrekening. Ook wel bekend als een online portemonnee. Vanuit deze wallet kunt u betalingen ontvangen en verrichten binnen het platform [[companyname]]. Betalingen kunnen buiten de producten van [[companyname]] is niet mogelijk met uitzondering naar het bij ons bekende bankrekeningnummer.</p><p>[[companyname]] behoud zich het recht voor om wijzigingen aan te brengen in de wallet als het nodig is. Dit is onder andere maar niet uitsluitend: dubble betalingen door systeem fout, uitspraak van een geschil, in verband met wanbetalingen of door een rechtspraak.<br>[[companyname]] hoeft voor het aanbrengen van wijzigingen hier niet voorafgaande of achter af de eigenaar van de wallet op de hoogte te stellen.</p><p>Het is mogelijk om uw persoonlijke wallet op het platform van [[companyname]] op te waarderen via het dashboard na het inloggen op de website.</p>', 'De wallet is een online portemonnee waar vanuit u betalingen kunt ontvangen en doen binnen het systeem van [[companyname]]', 'De wallet is een online portemonnee waar vanuit u betalingen kunt ontvangen en doen binnen het systeem van [[companyname]]', '', 1656441983, 0, 1656441983, 0),
(32, 17, 'en', 'Wallet', 'Wallet', '<p>The wallet within the platform of [[companyname]] is comparable to the balance in a bank account. Also known as an online wallet. From this wallet you can receive and make payments within the platform [[companyname]]. Payments are not possible outside the products of [[companyname]], with the exception of the bank account number known to us.</p><p>[[companyname]] reserves the right to make changes to the wallet if it is needed. This includes, but is not limited to: duplicate payments due to system error, judgment of a dispute, in connection with payment defaults or due to a court order.<br>[[companyname]] does not require the owner to make changes before or after. of the wallet.</p><p>It is possible to upgrade your personal wallet on the platform of [[companyname]] via the dashboard after logging in to the website.</p><p><h1>{{login}}</h1>{{login}}</p>', 'The wallet is an online wallet from which you can receive and make payments within the system of [[companyname]]', 'The wallet is an online wallet from which you can receive and make payments within the system of [[companyname]]', '', 1656441983, 0, 1656441983, 0);

